import React from "react";
import "./styles.css";
// import FontAwesome from "react-fontawesome";
// import faStyles from "font-awesome/css/font-awesome.css";

import "../../node_modules/font-awesome/css/font-awesome.min.css";
// import Skillsbackground from "./techimages/skillsbackgroundtrans.png";

function Skills() {
  return (
    <div
      id="skills"
      style={MainDiv}
      data-aos="fade-down"
      data-aos-duration="9000"
    >
      <div style={Heading}>
        <div>Skills</div>
      </div>
      <div
        className="shadow p-3 mb-5 rounded"
        style={{
          backgroundColor: "#F7F7F7",
          // backgroundImage: "url(" + Skillsbackground + ")",
          padding: "1%",
          borderRadius: "10px",
        }}
      >
        <div className="row" style={Content}>
          <div
            className="container"
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <div
              className="card border-0 ProjectCard shadow rounded ml-2 mr-2  mt-2 mb-2"
              data-aos="zoom-in"
              style={{
                position: "relative",
                justifyContent: "center",
                opacity: "0.9",
                backgroundColor: "white",
              }}
            >
              <div>
                <i
                  className="fa fa-desktop mb-3"
                  style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                  aria-hidden="true"
                ></i>
              </div>
              <div className="mt-3" style={{ color: "black" }}>
                FRONT END
              </div>
              <div
                className="SkillsCardLayover rounded"
                style={{ backgroundColor: "#c9dbf5" }}
              >
                <ul
                  style={{
                    listStyleType: "none",
                    borderBottom: "1px",
                    textAlign: "center",
                    padding: "0.5rem",
                  }}
                >
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    react | Redux
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    Heroku
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    MySQL
                  </li>
                </ul>
              </div>
            </div>
            <div
              className="card border-0 ProjectCard shadow rounded ml-2 mr-2  mt-2 mb-2"
              data-aos="zoom-in"
              style={{
                justifyContent: "center",
                opacity: "0.9",
                backgroundColor: "white",
              }}
            >
              <div>
                <i
                  className="fa fa-server mb-3"
                  style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                  aria-hidden="true"
                ></i>
              </div>
              <div className="mt-3" style={{ color: "black" }}>
                BACK END
              </div>
              <div
                className="SkillsCardLayover rounded"
                style={{ backgroundColor: "#b3c3de" }}
              >
                <ul
                  style={{
                    listStyleType: "none",
                    borderBottom: "1px",
                    textAlign: "center",
                    padding: "0.5rem",
                  }}
                >
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    react | Redux
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    Heroku
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    MySQL
                  </li>
                </ul>
              </div>
            </div>
            <div
              className="card border-0 ProjectCard shadow rounded ml-2 mr-2  mt-2 mb-2"
              data-aos="zoom-in"
              style={{
                justifyContent: "center",
                opacity: "0.9",
                backgroundColor: "white",
              }}
            >
              <div>
                <i
                  className="fa fa-database mb-3"
                  style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                  aria-hidden="true"
                ></i>
              </div>
              <div className="mt-3" style={{ color: "black" }}>
                DATABASE
              </div>
              <div
                className="SkillsCardLayover rounded"
                style={{ backgroundColor: "#b9c1dd" }}
              >
                <ul
                  style={{
                    listStyleType: "none",
                    borderBottom: "1px",
                    textAlign: "center",
                    padding: "0.5rem",
                  }}
                >
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    react | Redux
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    Heroku
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    MySQL
                  </li>
                </ul>
              </div>
            </div>
            <div
              className="card border-0 ProjectCard shadow rounded ml-2 mr-2  mt-2 mb-2"
              data-aos="zoom-in"
              style={{
                justifyContent: "center",
                opacity: "0.9",
                backgroundColor: "white",
              }}
            >
              <div>
                <i
                  className="fa fa-cloud mb-3"
                  style={{ fontSize: "90px", color: "rgb(94, 120, 166)" }}
                  aria-hidden="true"
                ></i>
              </div>
              <div className="mt-3" style={{ color: "black" }}>
                CLOUD
              </div>
              <div
                className="SkillsCardLayover rounded"
                style={{ backgroundColor: " #bdbdde" }}
              >
                <ul
                  style={{
                    listStyleType: "none",
                    borderBottom: "1px",
                    textAlign: "center",
                    padding: "0.5rem",
                  }}
                >
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    react | Redux
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    Heroku
                  </li>
                  <li
                    style={{
                      borderBottom: "1px solid #eee",
                      padding: "0.5rem",
                    }}
                  >
                    MySQL
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

const MainDiv = {
  marginTop: "70px",
  // height: window.innerHeight,
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

const Content = {
  fontWeight: "bold",
  fontSize: "22px",
  fontFamily: "papyrus",
  color: "rgb(68, 68, 68)",
  margin: "1%",
  padding: "5%",
  // textAlign: "left",
  // display: "inline-block",
};

export default Skills;
